// 8f929523ca7bc6265c1b4400bc234e39a0bffb47097b7ce966418720edac8f18302e302e313a313732363934313734393636313a5b2267656e61727440302e302e33225d
import { image, svg, color, vec, random, xorshift } from 'genart'

const bear = await image(
  'data:image/jpeg;base64,'
)

const s = svg({ width: bear.width(), height: bear.height() })

const gridSize = 9
const rowLength = Math.floor((s.width() - gridSize) / gridSize)
const columnLength = Math.floor((s.height() - gridSize) / gridSize)
const field = []
// calculate spread for each color pixel
for (let x = 0; x < s.width() - gridSize; x += gridSize) {
  for (let y = 0; y < s.height() - gridSize; y += gridSize) {
    let pixels = bear.get(x, y, gridSize, gridSize)
    const a = vec(pixels.flatMap((a) => [...a.filter((_, i) => i % 4 > 0)]))
    // const value = a.average()
    const value = (a.spread2() * 17) / 1000

    // field.push(a.spread2())
    console.log(value)
    field.push(value)
    const c = color(value, value, value)
    // console.log(a.spread())
    s.rect(gridSize, gridSize, { x, y, fill: c.hex() })
  }
}

const neighbors = [vec(1, 1), vec(0, 1), vec(-1, -1), vec(0, -1), vec(1, -1)]
let visited = Array.from(Array(columnLength + 1), () =>
  new Array(rowLength + 1).fill(false)
)

let path = s.path({ fill: 'none' })
const rng = xorshift()
for (let i = 0; i < 50; i++) {
  rng.random()
}
for (let j = 0; j < 1; j++) {
  const visit = (r) => {
    visited[r.y][r.x] = true
  }
  let r = vec(rng.integer(0, rowLength - 1), rng.integer(0, columnLength - 1))
  while (visited[r.y][r.x]) {
    r = vec(rng.integer(0, rowLength - 1), rng.integer(0, columnLength - 1))
  }
  // console.log('r', r)
  visit(r)

  const value = (v) => {
    const i = v.x + v.y * rowLength
    if (i > field.length) throw Error('out of bounds')
    return field[i]
  }
  const coords = (r) => {
    const v = vec(r.x * gridSize + gridSize / 2, r.y * gridSize + gridSize / 2)
    // s.circle(2, v.x, v.y)
    return v
  }
  const nextPoint = () => {
    let ivalue = value(r)
    const filteredNeighbors = neighbors
      .map((n) => r.clone().sub(n))
      .filter(
        ({ x: i, y: j }) => i > 0 && i < rowLength && j > 0 && j < columnLength
      )
      .filter(({ x: i, y: j }) => !visited[j][i])
    // console.log(filteredNeighbors, visited[2][1])
    if (filteredNeighbors.length === 0) {
      return null
    }

    // console.log(filteredNeighbors
    //   .sort((a, b) => {
    //     let adiff = Math.abs(ivalue - value(a))
    //     let bdiff = Math.abs(ivalue - value(b))
    //     return adiff - bdiff
    //   }).map((v) => Math.abs(ivalue - value(v))), filteredNeighbors, r)

    r = filteredNeighbors
      // .map((a) => [a, Math.abs(ivalue - value(a))])
      // .sort((a, b) => a[1] - b[1])[0][0]
      .sort((a, b) => {
        let adiff = Math.abs(ivalue - value(a))
        console.log(adiff, ivalue, value(a))
        let bdiff = Math.abs(ivalue - value(b))
        return adiff - bdiff
      })[0]
    visit(r)
  }

  // start
  const [sx, sy] = coords(r)
  path.moveTo(sx, sy)
  s.circle(2, sx, sy)

  if (nextPoint() === null) continue
  const [dx1, dy1] = coords(r)
  if (nextPoint() === null) continue
  const [dx2, dy2] = coords(r)
  if (nextPoint() === null) continue
  const [x, y] = coords(r)
  path.cCurve(dx1, dy1, dx2, dy2, x, y)

  for (let i = 0; i < 500; i++) {
    // for (let i = 0; i < rowLength; i++) {
    //   for (let j = 0; j < columnLength; j++) {
    //     const { x, y } = coords(vec(i, j))
    //     const vis = visited[j][i]
    //     s.circle(vis ? 3 : 2, x, y, { fill: vis ? 'red' : 'black' })
    //   }
    // }
    if (nextPoint() === null) break
    const [dx2, dy2] = coords(r)
    if (nextPoint() === null) break
    const [x, y] = coords(r)
    path.sCurve(dx2, dy2, x, y)
  }
}

s.path().cCurve(100, 100, 200, 200, 300, 0)

load(s)
load(bear)
